import React from 'react'
import Events from './components/Events'

class App extends React.Component {

  render() {
    let text
    if (this.state.isStatus === true) {
      text = 'In'
    } else {
      text = 'Out'
    }
    return (
      <div>
        <h2>You currently Log {text}</h2>
        <hr />
        <Events />
      </div>
    )
  }
}
export default App
